import React from 'react';
import Resume from './Images/Grey Clean CV Resume Photo_page-0001.jpg';

const Experience = () => {
  return (
    <div className="bg-color resume" id="resume">
      <div className="content">
        <h1>RESUME</h1>
        <p>
          I am hardworking who is willing to gain entry level experience. I am
          very reliable and punctual, with exceptionally dependable character,
          looking for an opportunity to increase knowledge. I have the passion
          for building websites.
        </p>
        <div className="flex">
          <div>
            <h1>EDUCATION</h1>
            <h4>BACHELOR OF COMPUTER APPLICATION</h4>
            <p>Abhinav Education Society Pune</p>
            <h5>2020</h5>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Experience;
